insert into dbo.CustomAttribute([TenantID], [TreatmentBMPID], [TreatmentBMPTypeCustomAttributeTypeID], [TreatmentBMPTypeID], [CustomAttributeTypeID])
select tb.TenantID, tb.TreatmentBMPID, 503 as TreatmentBMPTypeCustomAttributeTypeID, tb.TreatmentBMPTypeID, 91 as CustomAttributeTypeID
from dbo.TreatmentBMP tb
where tb.FromThisImport = 1 and tb.NumberOfConnectorPipeScreens is not null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select tb.TenantID, ca.CustomAttributeID, tb.NumberOfConnectorPipeScreens
from dbo.TreatmentBMP tb
join dbo.CustomAttribute ca on tb.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = 91
where tb.FromThisImport = 1

insert into dbo.CustomAttribute([TenantID], [TreatmentBMPID], [TreatmentBMPTypeCustomAttributeTypeID], [TreatmentBMPTypeID], [CustomAttributeTypeID])
select tb.TenantID, tb.TreatmentBMPID, 509 as TreatmentBMPTypeCustomAttributeTypeID, tb.TreatmentBMPTypeID, 94 as CustomAttributeTypeID
from dbo.TreatmentBMP tb
where tb.FromThisImport = 1 and tb.TrashAndDebrisStorageVolume is not null

insert into dbo.CustomAttributeValue(TenantID, CustomAttributeID, AttributeValue)
select tb.TenantID, ca.CustomAttributeID, tb.TrashAndDebrisStorageVolume
from dbo.TreatmentBMP tb
join dbo.CustomAttribute ca on tb.TreatmentBMPID = ca.TreatmentBMPID and ca.CustomAttributeTypeID = 94
where tb.FromThisImport = 1 and tb.TrashAndDebrisStorageVolume is not null


select tb.TreatmentBMPID, count(*)
from treatmentbmp tb
join TreatmentBMPType tt on tb.TreatmentBMPTypeID = tt.TreatmentBMPTypeID
join TreatmentBMPTypeCustomAttributeType ttcat on tt.TreatmentBMPTypeID = ttcat.TreatmentBMPTypeID
join CustomAttributeType cat on ttcat.CustomAttributeTypeID = cat.CustomAttributeTypeID
where tt.TreatmentBMPTypeID = 35 and tb.FromThisImport = 1 and cat.CustomAttributeTypeID in (91, 94)
group by tb.TreatmentBMPID having count(*) = 2


alter table dbo.TreatmentBMP DROP COLUMN NumberOfConnectorPipeScreens
alter table dbo.TreatmentBMP DROP COLUMN TrashAndDebrisStorageVolume
alter table dbo.TreatmentBMP DROP COLUMN FromThisImport
